import React, { Component } from "react";
import { Button } from "react-bootstrap";

import ListingThumb from "../components/ListingThumb";
import JobInformation from "../components/JobInformation";

export default class Lisitings extends Component {
  constructor(props) {
    super(props);

    this.state = { current: null };

    this.createThumbs = this.createThumbs.bind(this);
    this.changeCurrent = this.changeCurrent.bind(this);
  }

  changeCurrent(job) {
    this.setState({ current: job });
  }
  createThumbs() {
    console.log(this.props.jobs);
    return this.props.jobs.map(j => (
      <Button
        variant="success"
        style={{ display: "block", width: "40%" }}
        onClick={this.changeCurrent(j)}
      >
        <ListingThumb job={j} />
      </Button>
    ));
  }

  render() {
    return <div>{this.createThumbs()}</div>;
  }
}
